import { View, TouchableOpacity, Image, StyleSheet, Text } from 'react-native';

export default function Categories(props) {

 return (
    <TouchableOpacity>
        <Image
            source={props.img}
            style={styles.categoriesImg}
        />
        <Text> 
            props.children
        </Text>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
    categoriesImg: {

